import "./navbar.css";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function Navbar() {
  const [open, setOpen] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
function togglePopup() {
  setOpen((prevState) => {
    const newState = !prevState;
    if (newState) {
      // Close popup-2 if it's open
      const popup2 = document.getElementById("popup-2");
      if (popup2.classList.contains("active")) {
        popup2.classList.remove("active");
      }
    }
    return newState;
  });
}

function togglePopup1() {
  setOpen((prevState) => {
    const newState = !prevState;
    if (newState) {
      // Close popup-1 if it's open
      const popup1 = document.getElementById("popup-1");
      if (popup1.classList.contains("active")) {
        popup1.classList.remove("active");
      }
    }
    return newState;
  });
}


  function register() {
    // Your register function implementation
    var name = document.getElementById("registerName").value;
    var phoneNumber = document.getElementById("registerPhoneNumber").value;
    var email = document.getElementById("registerEmail").value;
    var password = document.getElementById("registerPassword").value;

    if (name === "" || phoneNumber === "" || email === "" || password === "") {
      alert("Please fill in all fields");
      return;
    }

    var num = /^[789]\d{9}$/;
    if (!phoneNumber.match(num)) {
      alert("Invalid Phone Number");
      return false;
    }

    var mailformat = /^[a-z0-9]+@[a-z]+\.[a-z]{2,3}$/;
    if (!email.match(mailformat)) {
      alert("Invalid email");
      return false;
    }

    var userData = {
      name: name,
      phoneNumber: phoneNumber,
      email: email,
      password: password,
    };

    localStorage.setItem(email, JSON.stringify(userData));

    alert("Registration successful");
    togglePopup();
  }

  function login() {
    // Your login function implementation
    var email = document.getElementById("loginEmail").value;
    var password = document.getElementById("loginPassword").value;

    var userData = JSON.parse(localStorage.getItem(email));

    if (userData && userData.password === password) {
      alert("Login successful");
      localStorage.setItem("isLoggedIn", "true");
      document.getElementById("logoutButton").style.display = "inline";
      document.getElementById("loginBtn").style.display = "none";
    } else {
      alert("Invalid email or password");
    }
    togglePopup();
  }

  function logout() {
    // Your logout function implementation
    document.getElementById("logoutButton").style.display = "none";
    document.getElementById("loginEmail").value = "";
    document.getElementById("loginPassword").value = "";
    document.getElementById("loginBtn").style.display = "inline";
    localStorage.setItem("isLoggedIn", "false");
    alert("You are now logged out!");
    togglePopup();
  }

  useEffect(() => {
    const isLoggedIn = localStorage.getItem("isLoggedIn") === "true";
    setIsLoggedIn(isLoggedIn);
  }, []);

  return (
    <nav>
      <div className="left">
        <a href="/" className="logo">
          <img src="/logo.png" alt="" />
          <span>HomeHaven</span>
        </a>
        <a href="/">Home</a>
        <a href="/about">About</a>
        <a href="/">Contact</a>
        <a href="/list">Listings</a>
      </div>
      <div className="right">
        {isLoggedIn ? (
          <div className="user">
            <img
              src="https://images.pexels.com/photos/91227/pexels-photo-91227.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
              alt=""
            />
            <span>John Doe</span>
            <Link to="/profile" className="profile">
              <div className="notification">3</div>
              <span>Profile</span>
            </Link>
            <button onClick={logout} className="logout">
              Logout
            </button>
          </div>
        ) : (
          <>
            <div className={open ? "popup active" : "popup"} id="popup-1">
              <div className="content">
                <div className="close-btn" onClick={togglePopup}>
                  x
                </div>
                <p className="log1">
                  Log In to{" "}
                  <span style={{ fontWeight: "bold", color: "#178F7A" }}>
                    Recipe Realm
                  </span>
                </p>
                <div className="input-field">
                  <input
                    id="loginEmail"
                    placeholder="Email"
                    className="validate"
                    type="email"
                  />
                </div>
                <div className="input-field">
                  <input
                    id="loginPassword"
                    type="password"
                    placeholder="Password"
                    className="validate"
                  />
                </div>
                <button className="second-button" onClick={login}>
                  Log In
                </button>
                <p>
                  Don't have an account?{" "}
                  <a onClick={togglePopup1}>
                    <span
                      style={{
                        color: "blue",
                        cursor: "pointer",
                        textDecoration: "underline",
                      }}>
                      Register
                    </span>
                  </a>
                </p>
              </div>
            </div>

            <div className={open ? "popup active" : "popup"} id="popup-2">
              <div
                className="content"
                style={{ height: "600px", top: "400px" }}>
                <div className="close-btn" onClick={togglePopup1}>
                  x
                </div>

                <p className="log1">
                  Create Your{" "}
                  <span style={{ fontWeight: "bold", color: "#178F7A" }}>
                    Recipe Realm
                  </span>{" "}
                  Account
                </p>
                <div className="input-field">
                  <input
                    id="registerName"
                    placeholder="Name"
                    className="validate"
                  />
                </div>
                <div className="input-field">
                  <input
                    id="registerPhoneNumber"
                    placeholder="Phone Number"
                    className="validate"
                  />
                </div>
                <div className="input-field">
                  <input
                    id="registerEmail"
                    placeholder="Email"
                    className="validate"
                    type="email"
                    required
                  />
                </div>
                <div className="input-field">
                  <input
                    id="registerPassword"
                    placeholder="Password"
                    className="validate"
                  />
                </div>
                <button className="second-button" onClick={register}>
                  Register
                </button>
                <p>
                  Already have an account?{" "}
                  <a onClick={togglePopup}>
                    <span
                      style={{
                        color: "blue",
                        cursor: "pointer",
                        textDecoration: "underline",
                      }}>
                      Login
                    </span>
                  </a>
                </p>
              </div>
            </div>

            <li>
              <a
                onClick={togglePopup}
                id="loginBtn"
                style={{ marginLeft: "-30px", cursor: "pointer" }}>
                Login
              </a>
            </li>
            <button
              id="logoutButton"
              style={{ display: "none" }}
              onClick={logout}
              className="logout">
              Logout
            </button>
          </>
        )}
        <div className="menuIcon">
          <img src="/menu.png" alt="menu icon" onClick={() => setOpen(!open)} />
        </div>
        <div className={open ? "menu active" : "menu"}>
          <a href="/">Home</a>
          <a href="/">About</a>
          <a href="/">Contact</a>
          <a href="/">Agents</a>
          <a href="/">Sign In</a>
          <a href="/">Sign Up</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
